import math
import sys
from collections import deque


class Circle:
    def __init__(self, x, y, vx, vy, r):
        self.x = x
        self.y = y
        self.vx = vx
        self.vy = vy
        self.r = r

    def __eq__(self, other):
        return self.x == other.x and self.y == other.y and self.vx == other.vx and self.vy == other.vy and self.r == other.r

    def __hash__(self):
        return hash((self.x, self.y, self.vx, self.vy, self.r))

    def __repr__(self):
        return 'Circle(x={0}, y={1}, vx={2}, vy={3}, r={4})'.format(self.x, self.y, self.vx, self.vy, self.r)

    def __lt__(self, other):
        return self.r < other.r

    def __gt__(self, other):
        return self.r > other.r

    def __le__(self, other):
        return self.r <= other.r

    def __ge__(self, other):
        return self.r >= other.r


def distance(c1, c2):
    return math.sqrt((c1.x - c2.x) ** 2 + (c1.y - c2.y) ** 2)


def angle(c1, c2):
    return math.atan2(c2.y - c1.y, c2.x - c1.x)


def rotate(c, theta):
    return Circle(c.x * math.cos(theta) - c.y * math.sin(theta),
                  c.x * math.sin(theta) + c.y * math.cos(theta),
                  c.vx, c.vy, c.r)


def collide(c1, c2):
    d = distance(c1, c2)
    if d > c1.r + c2.r:
        return False
    if d < abs(c1.vx - c2.vx) + abs(c1.vy - c2.vy):
        return False
    theta = angle(c1, c2)
    r1 = (c1.r ** 2 - d ** 2 + c2.r ** 2) / (2 * c1.r)
    r2 = (d ** 2 - c1.r ** 2 + c2.r ** 2) / (2 * c2.r)
    x1 = c1.x + (c1.vx - c2.vx) * (r1 / c1.r)
    y1 = c1.y + (c1.vy - c2.vy) * (r1 / c1.r)
    x2 = c2.x + (c2.vx - c1.vx) * (r2 / c2.r)
    y2 = c2.y + (c2.vy - c1.vy) * (r2 / c2.r)
    vx1 = math.sqrt(c1.r ** 2 - r1 ** 2) * (c1.vx / c1.r - theta * (r1 / c1.r))
    vy1 = math.sqrt(c1.r ** 2 - r1 ** 2) * (c1.vy / c1.r - theta * (r1 / c1.r))
    vx2 = math.sqrt(c2.r ** 2 - r2 ** 2) * (c2.vx / c2.r - theta * (r2 / c2.r))
    vy2 = math.sqrt(c2.r ** 2 - r2 ** 2) * (c2.vy / c2.r - theta * (r2 / c2.r))
    return Circle(x1, y1, vx1, vy1, r1), Circle(x2, y2, vx2, vy2, r2)


def merge(circles):
    circles.sort()
    while len(circles) > 1:
        c1 = circles.popleft()
        c2 = circles.popleft()
        c = collide(c1, c2)
        circles.append(c[0])
        circles.append(c[1])
    return circles


def main():
    n = int(input())
    circles = deque()
    for i in range(n):
        x, y, vx, vy, r = list(map(float, input().split()))
        circles.append(Circle(x, y, vx, vy, r))
    circles = merge(circles)
    if len(circles) == 0:
        print(n, 0)
    else:
        print(len(circles), round(circles[0].r, 3))


