def solve(r, c, maze):
    odd = []
    even = []
    for i in range(r):
        for j in range(c):
            if (i + j) % 2 == 0:
                even.append(maze[i][j])
            else:
                odd.append(maze[i][j])
    if len(odd) == 0 or len(even) == 0:
        return 1
    if len(odd) == 1 and len(even) == 1:
        return 0
    if len(odd) == 1:
        return 1
    if len(even) == 1:
        return 1
    return 2


