MOD = 1000000007


def factorial(n):
    if n == 0:
        return 1
    return (n * factorial(n-1)) % MOD


def nCr(n, r):
    return (factorial(n) * pow(factorial(r), MOD-2, MOD) *
            pow(factorial(n-r), MOD-2, MOD)) % MOD


def solve(n, arr, banned, seq, seq_len):
    if len(banned) == 0:
        if seq_len == 0:
            return 1
        else:
            return 0
    if len(seq) == 0:
        return 0
    if seq[0] in banned:
        return solve(n, arr, banned[1:], seq[1:], seq_len)
    else:
        ans = 0
        for i in range(arr[seq[0]-1]+1):
            ans = (ans + solve(n, arr, banned[1:], seq[1:], seq_len-i-1)) % MOD
        return ans


