import sys
import heapq
from collections import defaultdict


def dijkstra(graph, start):
    dist = {v: float('inf') for v in graph}
    dist[start] = 0
    heap = [(0, start)]
    while heap:
        d, u = heapq.heappop(heap)
        if d > dist[u]:
            continue
        for v, w in graph[u].items():
            if dist[u] + w < dist[v]:
                dist[v] = dist[u] + w
                heapq.heappush(heap, (dist[v], v))
    return dist


def shortest_path(graph, start, end):
    dist = dijkstra(graph, start)
    return dist[end] if dist[end] != float('inf') else -1


def shortest_path_word_ladder(start, end, dictionary):
    graph = defaultdict(dict)
    for word in dictionary:
        for i in range(len(word)):
            for c in 'ABCDEFGHIJKLMNOPQRSTUVWXYZ':
                if c != word[i]:
                    new_word = word[:i] + c + word[i+1:]
                    if new_word in dictionary:
                        graph[word][new_word] = 1
    return shortest_path(graph, start, end)


def main():
    input = sys.stdin.read
    data = input().split()
    n = int(data[0])
    dictionary = set(data[1::n+1])
    start = data[n+1]
    end = data[n+2]
    print(shortest_path_word_ladder(start, end, dictionary))


